    <div className="relative" ref={menuRef}>
      <button
        onClick={() => setIsOpen(!isOpen)}
        className={cn(
          'flex items-center gap-3 w-full p-3 rounded-md',
          'hover:bg-sidebar-accent transition-colors',
          'text-sidebar-foreground',
          collapsed && 'justify-center'
        )}
